import React from "react";
import AppLayout from "../components/AppLayout";
import { Row, Col, Carousel } from "antd";

const Home = () => {
  return (
    <AppLayout>
      <div>
        <Row gutter={[16, 16]}>
          <Col span={6} />
          <Col span={6} />
          <Col span={6} />
          <Col span={6} />

          <Col span={6} />
          <Col span={6} />
          <Col span={6} />
          <Col span={6} />
        </Row>
        <Row gutter={[16, 16]}>
          <Col span={6} />
          <Col span={6} />
          <Col span={6} />
          <Col span={6} />
        </Row>
      </div>
    </AppLayout>
  );
};

export default Home;
